import math
from typing import List

def gcd(a: int, b: int) -> int:
    while b:
        a, b = b, a % b
    return a

def trial_division(n: int) -> List[int]:
    if n < 2:
        return []
    factors = []
    while n % 2 == 0:
        factors.append(2)
        n //= 2
    f = 3
    limit = int(math.isqrt(n))
    while f <= limit and n > 1:
        while n % f == 0:
            factors.append(f)
            n //= f
            limit = int(math.isqrt(n))
        f += 2
    if n > 1:
        factors.append(n)
    return factors

